      case 478: // string_embedded_variable -> T_DOLLAR_OPEN_CURLY_BRACES expr '}' 
{ 
		  yyval.Object = new IndirectVarUse(yypos, 1, (Expression)value_stack.array[value_stack.top-2].yyval.Object); 
