        return;
      case 479: // string_embedded_variable -> T_DOLLAR_OPEN_CURLY_BRACES T_STRING_VARNAME '[' expr ']' '}' 
{ 
			yyval.Object = new ItemUse(yypos, new DirectVarUse(yypos, scanner.GetEncapsedString(value_stack.array[value_stack.top-5].yyval.Offset,value_stack.array[value_stack.top-5].yyval.Integer)), (Expression)value_stack.array[value_stack.top-3].yyval.Object); 
		}
        return;
      case 480: // string_embedded_variable -> T_CURLY_OPEN chain '}' 
{ 
		  yyval.Object = value_stack.array[value_stack.top-2].yyval.Object; 
		}
        return;
      case 481: // string_embedded_key -> T_STRING 
{ 
			/* Constants are not looked for within strings */
			yyval.Object = new StringLiteral(yypos, scanner.GetEncapsedString(value_stack.array[value_stack.top-1].yyval.Offset,value_stack.array[value_stack.top-1].yyval.Integer));
